import React from 'react';
import '../Styles/style_section.scss';

function Footer() {
  return (
    <div>
        <div className='footer alignItem '>
            <div className='flex gap-40 text-white font-semibold text-[20px] pt-30'>
                <div>About</div>
                <div>Quick Links</div>
                <div>Support</div>
                <div>Subscribe For Newsletter</div>
            </div>


        </div>
    </div>
  )
}

export default Footer
